import React, { Component } from 'react'

class ListaGravadores extends Component{
    render(){
        return(
            <ul>
                <li>GR-01</li>
                <li>GR-02</li>
                <li>GR-03</li>
                <li>GR-04</li>
            </ul>
        )
    }
}
export default ListaGravadores
